import React, { Component } from 'react'

export default class Front extends Component {
    constructor(props){
        super(props)
    }
    render() {
        return (
            <div>
                <React.fragement>
                    <h1>Header1</h1>
                        {this.props.children}
                    <h1>Footer</h1>
                </React.fragement>
            </div>
        )
    }
}
